import { createGlobalStyle } from "styled-components";

export const GlobalStyles = createGlobalStyle`@import url('https://fonts.googleapis.com/css2?family=Poppins:wght@300;400;500;700&display=swap');
   body{
      font-family: 'Poppins', sans-serif;
   }
   
`;
